import React from "react"

export default function Navbar() {
    return (
        <nav>
            <img src="../images/apple.png" className="nav--logo" />
            <div class="topnav" id="myTopnav">
                <a class="active" href="#home">Mac</a>
                <a href="#news">iPad</a>
                <a href="#contact">iPhone</a>
                <a href="#about">Watch</a>
                <a href="#about">AirPods</a>
                <a href="#about">TV & Home</a>
                <a href="#about">Only on Apple</a>
                <a href="#about">Accessories</a>
                <a href="#about">Support</a>
            </div>
        </nav>
    )



}

function myFunction() {
    var x = document.getElementById("myTopnav");
    if (x.className === "topnav") {
      x.className += " responsive";
    } else {
      x.className = "topnav";
    }
  }
